import React from "react";

function NavBar() {
  return (
    <nav className="nav-bar">
        <ul className="nav-bar-list">
            <img className="nav-bar-logo" src="http://cdn.onlinewebfonts.com/svg/img_323101.png" alt="logo" />
            <li><a href="#">Home</a></li>
            <li><a href="#">About</a></li>
            <li className="push-left"><a href="#">Portfolio</a></li>
        </ul>
    </nav>
  );
}

export default NavBar;
